import logo from './logo.svg';
import './App.css';
import { LoremIpsum } from "lorem-ipsum";

const lorem = new LoremIpsum();

function App() {
  return (
    <>
    <nav>
      <li>
        Home
      </li>
      <li>About</li>
      <li>Contact</li>
    </nav>
    <div className = "container">
    <p> {lorem.generateSentences(2)} </p>
    </div>
    </>
  );
}

export default App;
